import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import { BrowserRouter } from 'react-router-dom';
import { HeadProvider } from 'react-head';


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <BrowserRouter>
  <HeadProvider>
  <React.StrictMode>
    <App />
  </React.StrictMode>
  </HeadProvider>
  </BrowserRouter>
);
